import React, { FC } from "react";
import { TImage } from "categorie/types";

interface IThumbNailImages {
  images: Array<TImage>;
}

const ThumbNailImages: FC<IThumbNailImages> = ({ images }) => {
  return (
    <>
      {images.map((img) => (
        <img src={img.node.originalSrc} />
      ))}
    </>
  );
};

export default ThumbNailImages;
